package body CNNPackages is
    procedure get_buffer_windows (n : in integer; signal win_buffers : out win_array_buffer_t) is
        variable all_win_array : win_array_t;
        variable win_out_buffers : win_array_buffer_t(0 to n-1);
        variable j : integer := 0;	
        variable counters : integer_vector(0 to n-1) := (others => 0);
    begin	       
		all_win_array := get_all_windows_from_file;
        for x in 0 to 125 loop
            for y in 0 to 125 loop
                j := (x * 126 + y) mod n;
                win_out_buffers(j)(counters(j)) := all_win_array(x,y);
                counters(j) := counters(j) + 1;
            end loop;
        end loop;
        win_buffers <= win_out_buffers;
	end procedure;

    procedure generate_random_filter (n : in integer; signal filter_array : out filter_array_t) is
	    variable tmp_real : real;
        variable tmp_filter : filter_t;
        variable seed1 : positive := 990;
        variable seed2 : positive := n;
        variable filter_array_out : filter_array_t(0 to n-1);
	begin
        for i in 0 to n-1 loop
            for x in 0 to 2 loop
                for y in 0 to 2 loop
                    uniform(seed1 , seed2, tmp_real);
                    tmp_filter(x, y) := tmp_real;
                end loop;
            end loop;
            filter_array_out(i) := tmp_filter;
        end loop;
        filter_array <= filter_array_out;
    end procedure;

    function get_all_windows_from_file return win_array_t is 
	   variable win_out_array : win_array_t;
       variable tmp_win : win_t;	 
	begin	       
        for i in 1 to 126 loop
            for j in 1 to 126 loop
                for x in -1 to 1 loop
                    for y in -1 to 1 loop
                        tmp_win(x + 1, y + 1) := pic_in(i + x, j + y);
                    end loop;
                end loop;
                win_out_array(i - 1,j - 1) := tmp_win;
            end loop;
        end loop;
	    return win_out_array;
    end function;	
end CNNPackages;		   
